import React, { useState } from 'react';
import './CaseForm.css';

const CaseForm = ({ isOpen, onClose, onCaseCreated }) => {
  const [formData, setFormData] = useState({
    caseNumber: '',
    clientName: '',
    clientEmail: '',
    clientPhone: '',
    caseType: '',
    priority: 'Medium',
    status: 'Open',
    description: '',
    assignedTo: '',
    startDate: '',
    estimatedEndDate: ''
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!formData.caseNumber || !formData.clientName) {
      setError('Case number and client name are required');
      return;
    }

    try {
      setLoading(true);
      setError('');

      // TODO: Add API call to create case
      console.log('Creating case:', formData);

      // For now, just simulate success
      setTimeout(() => {
        onCaseCreated(formData);
        setFormData({
          caseNumber: '',
          clientName: '',
          clientEmail: '',
          clientPhone: '',
          caseType: '',
          priority: 'Medium',
          status: 'Open',
          description: '',
          assignedTo: '',
          startDate: '',
          estimatedEndDate: ''
        });
      }, 1000);

    } catch (err) {
      setError('Failed to create case');
    } finally {
      setLoading(false);
    }
  };

  if (!isOpen) return null;

  return (
    <div className="case-form-overlay">
      <div className="case-form-modal">
        <div className="case-form-header">
          <h2>Create New Case</h2>
          <button className="close-button" onClick={onClose}>Ã—</button>
        </div>

        <form onSubmit={handleSubmit} className="case-form">
          {error && <div className="error-message">{error}</div>}

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="caseNumber">Case Number *</label>
              <input
                type="text"
                id="caseNumber"
                name="caseNumber"
                value={formData.caseNumber}
                onChange={handleInputChange}
                placeholder="Enter case number"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="caseType">Case Type</label>
              <select
                id="caseType"
                name="caseType"
                value={formData.caseType}
                onChange={handleInputChange}
              >
                <option value="">Select case type</option>
                <option value="Elderly Care">Elderly Care</option>
                <option value="Disability Support">Disability Support</option>
                <option value="Mental Health">Mental Health</option>
                <option value="Child Care">Child Care</option>
                <option value="Respite Care">Respite Care</option>
                <option value="Other">Other</option>
              </select>
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="clientName">Client Name *</label>
              <input
                type="text"
                id="clientName"
                name="clientName"
                value={formData.clientName}
                onChange={handleInputChange}
                placeholder="Enter client name"
                required
              />
            </div>

            <div className="form-group">
              <label htmlFor="clientEmail">Client Email</label>
              <input
                type="email"
                id="clientEmail"
                name="clientEmail"
                value={formData.clientEmail}
                onChange={handleInputChange}
                placeholder="Enter client email"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="clientPhone">Client Phone</label>
              <input
                type="tel"
                id="clientPhone"
                name="clientPhone"
                value={formData.clientPhone}
                onChange={handleInputChange}
                placeholder="Enter client phone"
              />
            </div>

            <div className="form-group">
              <label htmlFor="assignedTo">Assigned To</label>
              <input
                type="text"
                id="assignedTo"
                name="assignedTo"
                value={formData.assignedTo}
                onChange={handleInputChange}
                placeholder="Enter assigned person"
              />
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="priority">Priority</label>
              <select
                id="priority"
                name="priority"
                value={formData.priority}
                onChange={handleInputChange}
              >
                <option value="Low">Low</option>
                <option value="Medium">Medium</option>
                <option value="High">High</option>
                <option value="Urgent">Urgent</option>
              </select>
            </div>

            <div className="form-group">
              <label htmlFor="status">Status</label>
              <select
                id="status"
                name="status"
                value={formData.status}
                onChange={handleInputChange}
              >
                <option value="Open">Open</option>
                <option value="In Progress">In Progress</option>
                <option value="On Hold">On Hold</option>
                <option value="Closed">Closed</option>
              </select>
            </div>
          </div>

          <div className="form-row">
            <div className="form-group">
              <label htmlFor="startDate">Start Date</label>
              <input
                type="date"
                id="startDate"
                name="startDate"
                value={formData.startDate}
                onChange={handleInputChange}
              />
            </div>

            <div className="form-group">
              <label htmlFor="estimatedEndDate">Estimated End Date</label>
              <input
                type="date"
                id="estimatedEndDate"
                name="estimatedEndDate"
                value={formData.estimatedEndDate}
                onChange={handleInputChange}
              />
            </div>
          </div>

          <div className="form-group">
            <label htmlFor="description">Case Description</label>
            <textarea
              id="description"
              name="description"
              value={formData.description}
              onChange={handleInputChange}
              placeholder="Enter case description and details"
              rows="4"
            />
          </div>

          <div className="form-actions">
            <button type="button" className="cancel-button" onClick={onClose}>
              Cancel
            </button>
            <button type="submit" className="submit-button" disabled={loading}>
              {loading ? 'Creating...' : 'Create Case'}
            </button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default CaseForm;
